-- ----------------------------
-- Table structure for scheduled_task
-- ----------------------------
DROP TABLE IF EXISTS `scheduled_task`;
CREATE TABLE `scheduled_task` (
  `TASK_ID` varchar(32) NOT NULL COMMENT '任务ID',
  `CLASS_NAME` varchar(100) NOT NULL COMMENT '类名称',
  `METHOD_NAME` varchar(100) NOT NULL COMMENT '方法名称',
  `REQ_PARAMS` varchar(100) DEFAULT NULL COMMENT '请求入参',
  `TASK_CRON` varchar(100) NOT NULL COMMENT 'cron表达式',
  `TASK_STATE` int(1) NOT NULL COMMENT '任务状态（0:启用 1:禁用）',
  `CREATE_TIME` datetime NOT NULL COMMENT '任务创建时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '任务修改时间',
  `REMARK` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`TASK_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时任务';

