  `DEF_ID` bigint(20) NOT NULL COMMENT '业务流程定义ID',
  `FLOW_CODE` varchar(50) NOT NULL COMMENT '流程编码(流程图的编码)',
  `FLOW_NAME` varchar(100) DEFAULT NULL COMMENT '流程名称',
