-- ----------------------------
-- Table structure for t_vacation_order
-- ----------------------------
DROP TABLE IF EXISTS `t_vacation_order`;
CREATE TABLE `t_vacation_order` (
  `VACATION_ID` bigint(20) NOT NULL COMMENT 'ID',
  `USER_ID` varchar(20) NOT NULL COMMENT '请假人',
  `START_TIME` date NOT NULL COMMENT '开始时间',
  `END_TIME` date NOT NULL COMMENT '结束时间',
  `VACATION_TYPE` int(3) NOT NULL COMMENT '请假类型',
  `VACATION_CONTEXT` varchar(200) NOT NULL COMMENT '请假原因',
  `VACATION_STATE` int(1) NOT NULL COMMENT '申请状态(0:待提交 1:审核中 2:已废弃 3:已完成)',
  `SYSTEM_CODE` varchar(10) NOT NULL COMMENT '系统来源',
  `BUSI_TYPE` varchar(10) NOT NULL COMMENT '业务类型',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`VACATION_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='假期管理';

